import React from 'react';
import { useState } from 'react';

const convertToFahrenheit = (temp) => {
    (temp - 273.15).toFixed(0);
}

const fetchedData = (props) => {
    const [data, setData] = useState({
        city: null,
        temp: null,
        feels_like: null,
        humidity: null,
        sunrise: null,
        sunset: null,
        cloudy: null
    });

    setData({
        city: props.responseObj.name,
        temp: convertToFahrenheit(props.responseObj.main.temp),
        feels_like: props.responseObj.main.feels_like,
        humidity: props.responseObj.main.humidity,
        sunrise: props.responseObj.sunrise,
        sunset: props.responseObj.sunset,
        cloudy: props.responseObj.clouds.all
    });

    return (
        <div>
            {props.responseObj.cod === 200 ?
            <div>
                <p> In {data.city}, it is currently {props.responseObj.main.temp}Â° Fahrenheit.</p>
            </div>
            : null}
        </div>
    )
}

export default fetchedData;
